import React from "react";
import "./Footer.css";
import { FiTwitter } from 'react-icons/fa'

function Footer({}) {
    return (
        <div className="footer">
          <h4> Words </h4>
          <InlineItems>
            <div style={{ color: '#F4A261' }}>
              <Icon size={64} icon={FiTwitter}/>
            </div>
            <div style={{ color: '#2A9D8F' }}>
                <Icon size={64} icon={FiTwitter}/>
            </div>
            <div style={{ color: '#E9C46A' }}>
                <Icon size={64} icon={FiTwitter}/>
            </div>
          </InlineItems>
        </div>
    )
}

export default Footer;
